INSERT INTO `commodity` VALUES ('16', 'C100 ULV Fog Machine', '0.000', '<span style=\'color: rgb(85, 85, 85); font-family: Tahoma, Geneva, sans-serif; font-size: 13px; line-height: 19.78333282470703px; background-color: rgb(253, 253, 253); \'>The compact C100 cold fogger is one of the most powerful and durable ULV machines in the market today. Equipped with a solenoid valve made out of Teflon and our exclusive1250 Watt motor. This fogger can produce a powerful flow rate between 30-60 LPH and can easily cover an area of 100 m² in less than a minute. With an adjustable droplet size between 5-50 microns, this fogger can quickly apply disinfectants, biocides or insecticides to erradicate vector carriers and pests.</span>', '201');
INSERT INTO `commodity` VALUES ('17', 'C150 ULV Fog Machine', '0.000', '<img src=\'data:image/jpeg;base64,\'><div><img src=\'data:image/jpeg;base64,\'></div><div><img src=\'data:image/jpeg;base64,\'></div>', '201');
INSERT INTO `commodity` VALUES ('18', 'BY100 Mini Butane/Propane Fog', '0.000', '<div><span style=\'background-color: rgb(253, 253, 253); color: rgb(85, 85, 85); font-family: Tahoma, Geneva, sans-serif; font-size: 13px; line-height: 19.78333282470703px; \'>VectorFog™ Mini Foggers are powered by a standard propane or butane gas cartridge. The gas is ignited by a pietzo and the gas heats a metal coil tube. The water or oil dilutant is then heated and mixed with the chemical to create a fog or mist. Thanks to its portability, the Mini fogger is ideal for fogging pesticides and disinfectants in a multitude of locations such as in homes, patios, parks, silos, chicken coops and</span></div><span style=\'color: rgb(85, 85, 85); font-family: Tahoma, Geneva, sans-serif; font-size: 13px; line-height: 19.78333282470703px; background-color: rgb(253, 253, 253); \'>greenhouses.</span>', '202');
INSERT INTO `commodity` VALUES ('19', 'H100 Thermal Fog Machine', '0.000', '<div><img src=\'data:image/jpeg;base64,\'></div><span style=\'color: rgb(85, 85, 85); font-family: Tahoma, Geneva, sans-serif; font-size: 13px; line-height: 19.78333282470703px; background-color: rgb(253, 253, 253); \'><div><span style=\'color: rgb(85, 85, 85); font-family: Tahoma, Geneva, sans-serif; font-size: 13px; line-height: 19.78333282470703px; background-color: rgb(253, 253, 253); \'><br></span></div>This portable thermal fogger is ideal for a wide range of uses including vector and pest control applications. Thanks to its portability, the H100 is capable of dispersing disinfectants and insecticides quickly and effectively in a variety of locations such as parks, warehouses, greenhouses, factories, farms, poultry houses, silos and more.</span>', '202');
INSERT INTO `commodity` VALUES ('20', 'H200 热力烟雾机', '0.000', '<div><img src=\'data:image/jpeg;base64,\'></div><div><img src=\'data:image/jpeg;base64,\'></div><div><img src=\'data:image/jpeg;base64,\'></div><div><span style=\'color: rgb(85, 85, 85); font-family: Tahoma, Geneva, sans-serif; font-size: 13px; line-height: 19.78333282470703px; background-color: rgb(253, 253, 253); \'><br></span></div><span style=\'color: rgb(85, 85, 85); font-family: Tahoma, Geneva, sans-serif; font-size: 13px; line-height: 19.78333282470703px; background-color: rgb(253, 253, 253); \'>本产品采用特殊耐热，抗腐蚀的优质不锈钢材料制作而成，因此能达到抵抗由化学药剂，柴油，氧化剂和酸等构成的烟雾剂而造成的热量和腐蚀，同时本产品拥有美观大方的外观设计，耐用的高效率性能和长久的产品寿命。</span>', '202');
INSERT INTO `commodity` VALUES ('21', 'H300 Vehicle Mounted Fog Machine', '0.000', '<img src=\'data:image/jpeg;base64,\'><div><br></div><div><span style=\'color: rgb(85, 85, 85); font-family: Tahoma, Geneva, sans-serif; font-size: 13px; line-height: 19.78333282470703px; background-color: rgb(253, 253, 253); \'>Designed to be fitted to the back of a motorbike, motortrike or quad-bike, the H300 is the ideal fogger for fast dispersion of disinfectants or insecticides in towns and farms. Features include a 15 litre tank, automatic start and a powerful outflow of 52 LPH. It can also be custom built to fit customer’s specific requirements.</span>\r\n</div>', '202');

