INSERT INTO `company` VALUES ('1', '广州竭诚所至贸易有限公司', '<p style=\"padding: 0px 20px 20px; list-style: none; border: 0px; text-indent: 3em; letter-spacing: 1px; \">广州竭诚所至贸易有限公司由分子工学专业毕业的吴雪霞&nbsp;女士（法人代表） 创立于1990年韩国全南长城郡。初期主要与三星合作并生SADFSAFASDFASDF产高质量电子产品，例如 吸尘器，洗衣机，冰箱等产品。之后着手于例如电机，电路板，喷嘴技术和塑料成型技术。并在2005年成功开发生产出关于有效防治带菌病虫害的超低容量(ULV)载体冷雾设备，和重点开发创新超低容量的喷雾喷嘴以及机身的设计。为广大用户的使用带来了简便。</p><p style=\"padding: 0px 20px 20px; list-style: none; border: 0px; text-indent: 3em; letter-spacing: 1px; \">曾有过和LG，三星等大型企业保持物流贸易合作关系的Sean Yeom先生在2009年加入了由自己父亲GJ Yeom 先生所创立的VectorFog™ 公司，目前主要负责产品创新设计和生产，在本公司SM B100型号超低容量(ULV)载体冷雾机初次上市后基于高科技和用于创新设计的因素，在取得了全球性的成功。之后保持引进高新病虫害防疫设备并取得持续性的成功。</p><p style=\"padding: 0px 20px 20px; list-style: none; border: 0px; text-indent: 3em; letter-spacing: 1px; \">如今，在全世界病有关病虫害防治的产品与设备。并且一直立志于保持由供，并被广大用户所使用。</p><div class=\"image_text\"><img src=\"http://14.147.88.121:8888/lowrie/resources/images/fore/abuot_uspic.jpg\" width=\"307\" height=\"207\" style=\"margin: 0px; padding: 0px 10px 20px 20px; list-style: none; float: left; display: inline; \"></div>', '测试企业地址', '1388888888', '020-8888888', 'linxiaosheng@outlook.com');

