INSERT INTO `news` VALUES ('10', '热力喷雾机', '<span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, 宋体; line-height: 28px; text-indent: 25px;\">专业从事农林环保机械及光学仪器研发及生产。目前主要生产TS一35系列、Ts一10系列热力喷雾机，是一种应用冲压式火箭发动机为动力的、以超低容量方式施放杀虫杀菌药剂的高新技术产品。工作效率高:本机每小时可对果树施药达17亩到27亩(视果树高度及密度不同).是其它施药器材的十几倍。杀灭率高:由于其施放无死角、附着力好、抗雨水冲刷等特点，加上其通用稀释剂柴油本身也具有一定的杀虫效果，因而杀灭率高，尤其是在大棚、下水道、室内等密闭空间，效果更是良好。射程大:对于果树、林木等高度大的作业环境.其效率是无所匹敌的。穿透力强:由于是颗粒极小的烟雾，有极高穿透力和渗透力。对于密度大的棉田，中后期小麦、水稻.蔗田、高粱、玉米等高秆植物，以及下水道，垃圾道等曲折迂回、有死角而无法直接施药的场所，有很好的效果。用药少、残留低:由于施药均匀、无死角，使杀灭率提高，减小了施药次数;同等面积相对用药量少，所以农药残留也低。是绿色种植的最佳选择。节水:由于稀释比例小，特别适用于!_!J区，尤.其黄土高原等缺水.地区使用。</span>', '2013-09-15 13:56:41');
INSERT INTO `news` VALUES ('11', '测试', '阿德法撒旦法年', '2013-12-01 18:13:37');
INSERT INTO `news` VALUES ('12', '放大看了就发生了附近的洒落', '法兰克就是犯贱啊四六级发牢骚激发了解放大路京东方垃圾堆放辣椒放辣椒粉的垃圾受到法律事件多发啊数量的风景阿萨德了附近阿斯蒂芬&nbsp;', '2013-12-01 18:14:02');

